import React from "react";

const Footer = () => {
  return (
    <footer className="footer text-center" id="footer">
            <div className="container text-center">
                    <div>
                    col-lg-6 col-md-6 col-sm-12 col-xs-12
                    .col-sm-4
                        <h4 className="mb-4">Contact</h4>
                        <h5 className="mb-4">womeninstem@mulife.ie</h5>
                        <h5 className="mb-4">Maynooth University Society</h5>
                    </div>
                    <div>
                        <h4 className="mb-4">Follow</h4>
                        <a className="col btn btn-outline-light btn-social mx-1" href="#!"><i className="fab fa-fw fa-instagram"></i></a>
                        <a className="col btn btn-outline-light btn-social mx-1" href="#!"><i className="fa fa-fw fa-envelope"></i></a>
                        <a className="col btn btn-outline-light btn-social mx-1" href="#!"><i className="fa fa-fw fa-link"></i></a>
                    </div>
            </div>
    </footer>
  );
};

export default Footer;
